import React from 'react';
import BannerProcess from '../components/Banner/BannerProcess';




const Scrum = () => {
    return(
        <div className="body_wrapper">
 
            <BannerProcess 
                Pclass="scrum_banner_area"                
                P2class="shape"
                Title="TitleScrum" 
                TextD="TextDScrum"
                img_process="img-scrum-int.png"/>            
        </div>
    )
}
export default Scrum;
